package main

import (
	"encoding/json"
	"github.com/stretchr/testify/assert"
	"net/http"
	"net/http/httptest"
	"strings"
	"testing"
)

func TestService_Upload(t *testing.T) {
	postReq := fileUploadRequest{
		Filename: "algoritm-raspoznavaniya-zhestov-ruk-na-osnove-skeletnoy-modeli-kisti-ruki.pdf",
		Musician: "musician",
		Song:     "song",
		Category: "category",
		Content:  "",
	}
	postReqJSON, err := json.Marshal(&postReq)
	assert.NoError(t, err)
	router, err := SetUpRouter()
	assert.NoError(t, err)
	w := httptest.NewRecorder()
	req, _ := http.NewRequest("PUT", "/file", strings.NewReader(string(postReqJSON)))
	router.ServeHTTP(w, req)
	assert.Equal(t, w.Code, http.StatusOK)
}
